//components
import InputTodo from "./components/inputTodo";
import ListTodos from "./components/listTodo"; 
function App() {
  return (
    <Router>
      <div className="container">
             <Route exact pInputTodo/>
             <ListTodos/>
      </div>
    </Router>
  );
}

export default App;
